import React from 'react';

export const SortIcon = () => {
    return (
        <svg
            width="16"
            height="16"
            viewBox="0 0 16 16"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
        >
            <path
                d="M6.01875 16H9V5.33333H6.01875V16ZM15 16L15 0H11.9812V16H15ZM-9.53674e-07 16H3V10.6667H-9.53674e-07V16Z"
                fill="#4E4E4E"
            />
        </svg>
    );
};
